import React from "react";
import './App.css';

function Navbar() {
  return (
     <div style={{ padding: "40px", fontSize: "40px" }}>
      <i className="ri-home-2-fill"></i>
      <i className="ri-infinity-fill"></i>
      <i className="ri-user-fill"></i>
    </div>
  );
}

export default Navbar;
